package operator;

public class Dowhile {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int i = 11;           // 
		do  
		{
			System.out.println(i);  // print 11, 
			i++;                       // 11+1 = 12
		}while(i<=1);                 // 12<=1 no 
	
	}

}